import React, { useLocation } from 'react';

function ResultPage() {
    const location = useLocation();
    const { result } = location.state;

    return (
        <div>
            <h1>Resultado</h1>
            <p>Petshop: {result.petshop}</p>
            <p>Custo Total: R$ {result.totalCost}</p>
        </div>
    );
}

export default ResultPage;
